  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, physical, and other data were
  collected from bottle and CTD casts from the KNORR and MELVILLE from 18 July 1972
  to 10 June 1974. Data were collected by the Scripps Institution of Oceanography
  (SIO) as part of the International Decade of Ocean Exploration / Geochemical Ocean
  Study (IDOE/GEOSECS). Physical parameters include depth, temperature, salinity,
  and pressure. Chemical parameters include concentrations of oxygen, phosphate, nitrate,
  nitrite, and silicate. Analog data are availabe for this accession by contacting
  NODC user services.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
